Replacing $ifNull with $cond in MongoDB aggregation<p>I am thinking of migrating my app from MongoDB 3.6 to AWS DocumentDB. I am checking to see if everything is supported and I found <code>$ifNull</code> (aggregation) in the code. DocumentDB does not support <code>$ifNull</code>.</p>
<p>For a sample set of documents:</p>
<pre><code>[
  { &quot;hostname&quot;: &quot;foo&quot;, &quot;name&quot;: &quot;a&quot;, &quot;is_valid&quot;: true },
  { &quot;hostname&quot;: &quot;foo&quot;, &quot;name&quot;: &quot;b&quot;, &quot;is_valid&quot;: false },
  { &quot;hostname&quot;: &quot;foo&quot;, &quot;name&quot;: &quot;c&quot; }
]
</code></pre>
<p>I want to group document by the hostname field and if the is_valid field does not exist, make it true. This is the current aggregation query:</p>
<pre><code>{
  $group: {
    _id: &quot;$hostname&quot;,
    boxes: {
      $push: {
        name: &quot;$name&quot;,
        is_valid: { $ifNull: [&quot;$is_valid&quot;, true]}
      }
    }
  }
}
</code></pre>
<p>It returns:</p>
<pre><code>{
  &quot;_id&quot;: &quot;foo&quot;,
  &quot;boxes&quot;: [
    { &quot;name&quot;: &quot;a&quot;, &quot;is_valid&quot;: true },
    { &quot;name&quot;: &quot;b&quot;, &quot;is_valid&quot;: false },
    { &quot;name&quot;: &quot;c&quot;, &quot;is_valid&quot;: true }
  ]
}
</code></pre>
<p>This is what I have tried:</p>
<pre><code>{
  $group: {
    _id: &quot;$hostname&quot;,
    boxes: {
      $push: {
        name: &quot;$name&quot;,
        is_valid: { $cond: [{$ne: [&quot;$is_valid&quot;, null]}, &quot;$is_valid&quot;, true]}
      }
    }
  }
}
</code></pre>
<p>But that returns:</p>
<pre><code>{
  &quot;_id&quot;: &quot;foo&quot;,
  &quot;boxes&quot;: [
    { &quot;name&quot;: &quot;a&quot;, &quot;is_valid&quot;: true },
    { &quot;name&quot;: &quot;b&quot;, &quot;is_valid&quot;: false },
    { &quot;name&quot;: &quot;c&quot; }
  ]
}
</code></pre>
<p>How can I translate <code>$ifNull</code> into an equivalent <code>$cond</code>?</p>

