How to query nested objects<p>MongoDB I have one document, I need to get one object,
if <code>locale.en</code> then it will return that info
if <code>locale.fr</code>' then it will return that info</p>
<pre><code>{
   &quot;locale&quot;: {
        &quot;en&quot;: {
          &quot;dashboard&quot;: {
            &quot;DASHBOARD_TITLE&quot;: &quot;Some title&quot;
          }
        },
        &quot;fr&quot;: {
          &quot;dashboard&quot;: {
            &quot;DASHBOARD_TITLE&quot;: &quot;Some title french&quot;
          }
        },
        &quot;pr&quot;: {
          &quot;dashboard&quot;: {
            &quot;DASHBOARD_TITLE&quot;: &quot;Some title portugues&quot;
          }
        }
      }
    }
</code></pre>
<p>How to query this specific object?</p>
<pre><code>db.collectionName.find({locale.en})
</code></pre>
<p><a href="https://i.stack.imgur.com/JtMBh.jpg" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/JtMBh.jpg" alt="enter image description here" /></a></p>

answer:
Linux uses physical ram to calculate the maximum number of thread therefore it is different for every system (https://github.com/torvalds/linux/blob/master/kernel/fork.c)

`static void set_max_threads(unsigned int max_threads_suggested)
{	u64 threads;
	if (fls64(totalram_pages) + fls64(PAGE_SIZE) > 64)
		threads = MAX_THREADS;
	else
		threads = div64_u64((u64) totalram_pages * (u64) PAGE_SIZE,
				    (u64) THREAD_SIZE * 8UL);

	if (threads > max_threads_suggested)
		threads = max_threads_suggested;

	max_threads = clamp_t(u64, threads, MIN_THREADS, MAX_THREADS);
}`

